import {FormControl, Grid, OutlinedInput} from "@material-ui/core";
import Button from "@material-ui/core/Button";


const AddNewStatusForm = () => (
	<Grid
		xs={12}
		lg={12}
		sm={12}
		md={12}
		item
	>
		<FormControl
			variant={"outlined"}
			fullWidth
		>
			<OutlinedInput
				placeholder={"Status name"}
				label={"Status name"}
				name={"name"}
				id={"name"}
				value={""}
				fullWidth
			/>
		</FormControl>
		<FormControl
			variant={"outlined"}
		>
			<Button
				variant={"outlined"}
			>
				Add
			</Button>
		</FormControl>
	</Grid>
);

export default AddNewStatusForm;
